import React from "react";
import videoImg1 from "../assets/images/video-list-1.jpg";
import videoImg2 from "../assets/images/video-list-2.jpg";
import videoImg3 from "../assets/images/video-list-3.jpg";
import videoImg4 from "../assets/images/video-list-4.jpg";
import videoImg5 from "../assets/images/video-list-5.jpg";
import videoImg6 from "../assets/images/video-list-6.jpg";
import videoImg7 from "../assets/images/video-list-7.jpg";
import videoImg8 from "../assets/images/video-list-8.jpg";

const videoObjects = [
  {
    image: `${videoImg1}`,
    title: `Become A Travel Pro In 7O0npxe Easy Lesson`,
    name: `Scotty Cranmer`,
  },
  {
    image: `${videoImg2}`,
    title: `Les Houches The Hidden Gem Of The Chamonix`,
    name: `Scotty Cranmer`,
  },
  {
    image: `${videoImg3}`,
    title: `Travel Health Useful Medical Information For`,
    name: `Scotty Cranmer`,
  },
  {
    image: `${videoImg4}`,
    title: `Cheap Airline Tickets Great Ways To Save`,
    name: `Emily Harper`,
  },
  {
    image: `${videoImg5}`,
    title: `Take A Romantic Break In A Boutique Hotel`,
    name: `Ethan Owen`,
  },
  {
    image: `${videoImg6}`,
    title: `Choose The Perfect Accommodations`,
    name: `Lydia Perez`,
  },
  {
    image: `${videoImg7}`,
    title: `Cruising Destination Ideas`,
    name: `Timothy Austin`,
  },
  {
    image: `${videoImg8}`,
    title: `Train Travel On Track For Safety`,
    name: `Scotty Cranmer`,
  },
];

const NextUpVideos = () => {
  return videoObjects.forEach((obj) => {
    return (
      <div>
        <div>
          <img src={obj.image}></img>
        </div>
        <div>
          <p>{obj.title}</p>
          <p>{obj.name}</p>
        </div>
      </div>
    );
  });
};
export default NextUpVideos;

